import React, { Component } from 'react';
import ControlledCarousel from './ControlledCarousel';
import 'react-day-picker/lib/style.css'
//import logo from './logo.svg';
import './App.css';


class App extends Component {

  constructor(props, context) {
    super(props, context);
    this.state = {

    }
  }

  render() {
    return (
      <React.Fragment>
        <div className="App">
          <header className="App-containers">


            <a
              href="/department"
              className="btn btn-outline-primary btn-lg main-button"
              role="button"
              aria-pressed="true"
            >
              Department
                    </a>
            <a
              href="/reserve"
              className="btn btn-outline-primary btn-lg main-button"
              role="button"
              aria-pressed="true"
            >
              Reserve
                    </a>
            <a
              href="/trip"
              className="btn btn-outline-primary btn-lg main-button"
              role="button"
              aria-pressed="true"
            >
              Trip
                    </a>

            <ControlledCarousel></ControlledCarousel>

          </header>
        </div>
      </React.Fragment>
    );
  }
}



export default App;
